import './App.css';
import React from 'react';
import { Reset } from "styled-reset";
import { Route, Routes } from 'react-router-dom';
import LandingPage from './components/landing/LandingPage';

const App = () => {
  return (
    <div className='font'>
      <Reset />

      <Routes>
        {/* Landing Page */}
        <Route path="/landing" element={<LandingPage />} />
        {/* Login */}

      </Routes>
    </div>
  );
};

export default App;
